              "file": "jenkins-init-scripts/package-listing.sh",
              "line": 13,
              "reviewer": ids["zxiiro"],
              "message": "I\u0027d consider this a breaking change as we need to ensure all bootscripts use the new init scripts change. The init scripts patch wasn\u0027t a breaking change because it didn\u0027t require people to install it. This patch would now force people upgrading global-jjb to have to install the new init scripts moving forward.\n\nI would put a note in the commit message to state that this is a breaking change.",
