          "timestamp": 1527784391000,
          "reviewer": ids["zxiiro"],
          "message": "Patch Set 1: Code-Review-2\n\nI use these periodically to administer Jenkins. These are for us to copy-paste into the script console.\n\nI could see this being moved into lftools if we add some commands to perform the same things here.\n\nmaybe we can add:\n\n    lftools jenkins get-creds\n    lftools jenkins node delete\n    lftools jenkins node delete --force"
