            "comments": [
              {
                "file": "jjb/lf-maven-jobs.yaml",
                "line": 184,
                "reviewer": ids["agrimberg"],
                "message": "What\u0027s with the leading \u0027:\u0027 ?",
                "patchSetTimestamp": 1504740450000
              },
              {
                "file": "jjb/lf-maven-jobs.yaml",
                "line": 184,
                "reviewer": ids["zxiiro"],
                "message": "I was doing it to make it stand out. In Sphinx this marks it as a parameter and bolds the text but in this YAML it does nothing.",
                "patchSetTimestamp": 1504740450000
              },
              {
                "file": "jjb/lf-maven-jobs.yaml",
                "line": 206,
                "reviewer": ids["agrimberg"],
                "message": "Not certain if ONAP is more correct or not right now, but they have a comment trigger of \u0027please release\u0027 to do this right now. Personally I think the imperative of this is more suited to the intent but if we bring this in to that community we\u0027re going to have to do some retraining.\n\nI\u0027ll note that the ONAP trigger is currently only on their docker daily jobs.",
                "patchSetTimestamp": 1504740450000
              },
              {
                "file": "jjb/lf-maven-jobs.yaml",
                "line": 206,
                "reviewer": ids["zxiiro"],
                "message": "please release doesn\u0027t really describe what\u0027s happening imo. The reason I picked the wording here is because I plan on having 2 triggers.\n\n1) build release - which builds the release and produces staging repo\n2) promote release - which will hopefully hit the Nexus API to tell it to release the artifacts.",
                "patchSetTimestamp": 1504740450000
              },
              {
                "file": "jjb/lf-maven-jobs.yaml",
                "line": 206,
                "reviewer": ids["zxiiro"],
                "message": "FWIW if there\u0027s pushback they can override the trigger in their own jobs since \"gerrit_release_trigger\" is a variable.",
                "patchSetTimestamp": 1504740450000
              }
            ],
