                "line": 595,
                "reviewer": ids["zxiiro"],
                "message": "So leaving the key as \"condition\" is fine but the redefinition should have a more specific prefix so that we know it\u0027s for this trigger. Using the suggestion above it might look like this:\n\n condition: \u0027{para-trigger-condition}\u0027\n upstream-job-logs-url: \u0027{para-trigger-upstream-job-logs-url}\u0027\n job-to-trigger: \u0027{para-trigger-job-to-trigger}\u0027",
