            "timestamp": 1507929434000,
            "reviewer": ids["zxiiro"],
            "message": "Patch Set 2: Code-Review+2\n\n(1 comment)\n\nOk I understand why verify jobs are failing the pattern now. It\u0027s because the merge job is has separate templates in it\u0027s name to handle multiple types but for some reason we decided to make the verify job a single job rather than multiple jobs so the verify is getting parsed poorly. If it\u0027s for efficiency because we don\u0027t want to launch many jobs then we do need a separate file-paths setting for the verify that\u0027s different then the merge job as done in this patch.\n\nI still think we should be moving the file-paths into a {obj:var} setting as we do with Maven jobs that do this similarly. That would be an improvement. I am ok with merging this firstly and then working on the improvement as a separate patch though."
